import React from 'react';
import '@vkontakte/vkui/dist/fonts.css';
import {Panel, View} from "@vkontakte/vkui";

//
const MainScreens = () => {
    return (
        <View activePanel="profile">
            <Panel id="profile">Profile</Panel>
        </View>
    );
};


export default MainScreens;
